import logo from './salad.png'; // Tell webpack this JS file uses this image


import data from "./data/data.json";


const newdata = data.map(data => {
  return (
    <div>
      <h1>Hola</h1>
    </div>
  );
});

export default class Main extends Component {
  render() {
    <div className="logoCont">
    <img src={logo} alt="Logo" width="414px" height="248px" />
      <div className="logo">
    </div>
    </div>

    return newdata;
  }
}
